import { Button } from "./Feedback.styled";

export class Feedback extends { Component } {
    render() {
        return (
            <div>
           <h1>Please leave feedback</h1>
        <Button type="button" >Good</Button>
        <Button type="button">Neutral</Button>
        <Button type="button">Bad</Button>
            </div>
        )
    }
}
